import React, { useState } from "react";
import axios from "axios";

function GetForecasting() {
  const [salesData, setSalesData] = useState('');
  const [purchasesData, setPurchasesData] = useState('');
  const [forecastedSales, setForecastedSales] = useState(null);
  const [updatedInventory, setUpdatedInventory] = useState(null);
  const [wastage, setWastage] = useState(null);

  const parseInputData = (input) => {
    let data = input.split(',');
    let parsedData = {};
    data.forEach((item) => {
      let [key, value] = item.split(':');
      parsedData[key.trim()] = parseFloat(value.trim());
    });
    return parsedData;
  };

  const submitData = async () => {
    try {
      // Parse the input data into objects
      const parsedSalesData = parseInputData(salesData);
      const parsedPurchasesData = parseInputData(purchasesData);

      // Prepare the payload
      const payload = {
        daily_sales: parsedSalesData,
        purchases: parsedPurchasesData,
      };

      // Make the POST request to the backend
      const response = await axios.post('http://127.0.0.1:5000/api/forecast', payload);

      // Set the response data into state
      setForecastedSales(response.data.forecasted_sales);
      setUpdatedInventory(response.data.updated_inventory);
      setWastage(response.data.wastage);
    } catch (error) {
      console.error('There was an error!', error);
      alert('An error occurred. Please try again.');
    }

    // Send purchasesData to backend to store in backend's variable (like AddSalesData)
    try {
      const payloadForPurchases = {
        purchases_data: purchasesData, // Send the raw input
      };

      // Send the entered purchases data to the backend
      await axios.post('http://127.0.0.1:5000/api/store-purchases', payloadForPurchases);

      console.log("Purchases data stored in backend successfully!");
    } catch (error) {
      console.error('Error storing purchases data in backend:', error);
    }
  };

  return (
    <div className="container mt-4">
      <h2 className="text-center mb-4">Forecasting Management</h2>

      <div className="row justify-content-center">
        <div className="col-md-6">
          <div className="mb-3">
            <label htmlFor="purchases-data" className="form-label">Enter number of days for Purchases</label>
            <input
              type="text"
              id="purchases-data"
              className="form-control"
              value={purchasesData}
              onChange={(e) => setPurchasesData(e.target.value)}
              placeholder="e.g., Day1: 100, Day2: 150"
            />
          </div>

          <div className="text-center">
            <button className="btn btn-primary" onClick={submitData}>Submit</button>
          </div>

          {forecastedSales && (
            <div className="mt-4">
              <h3 className="text-center">Results</h3>
              <div className="card mt-3">
                <div className="card-body">
                  <h5 className="card-title">Forecasted Sales</h5>
                  <pre>{JSON.stringify(forecastedSales, null, 2)}</pre>
                </div>
              </div>
              <div className="card mt-3">
                <div className="card-body">
                  <h5 className="card-title">Updated Inventory</h5>
                  <pre>{JSON.stringify(updatedInventory, null, 2)}</pre>
                </div>
              </div>
              <div className="card mt-3">
                <div className="card-body">
                  <h5 className="card-title">Wastage</h5>
                  <pre>{JSON.stringify(wastage, null, 2)}</pre>
                </div>
              </div>
            </div>
          )}
        </div>
      </div>
    </div>
  );
}

export default GetForecasting;
